// src/pages/Dashboard.js
import React from 'react';
import '../styles/Dashboard.css';

function Dashboard() {
  return (
    <div className="dashboard">
      <h1>Freelancer Dashboard</h1>
      <div className="profile-section">Profile Overview</div>
    </div>
  );
}

export default Dashboard;
